import React, { useEffect, useState } from "react";
import { View, Text, FlatList, ActivityIndicator, StyleSheet, TouchableOpacity, Modal, ScrollView, Button } from "react-native";
import AsyncStorage from "@react-native-async-storage/async-storage";
import axios from "axios";

const WorkoutHistory = ({ userId }) => {
  const [workouts, setWorkouts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [selectedWorkout, setSelectedWorkout] = useState(null);
  const [modalVisible, setModalVisible] = useState(false);

  useEffect(() => {
    const fetchHistory = async () => {
      try {
        // Replace with your backend URL
        const response = await axios.get(
          `http://localhost:5001/api/closed_workouts?user_id=${userId}`
        );
        setWorkouts(response.data.workouts);
      } catch (err) {
        setError("Failed to load workout history");
      } finally {
        setLoading(false);
      }
    };
    if (userId) fetchHistory();
  }, [userId]);

  const handleWorkoutPress = (workout) => {
    setSelectedWorkout(workout);
    setModalVisible(true);
  };

  const closeModal = () => {
    setModalVisible(false);
    setSelectedWorkout(null);
  };

  if (loading) return <ActivityIndicator style={{ marginTop: 20 }} />;
  if (error) return <Text style={styles.error}>{error}</Text>;
  if (!workouts.length) return <Text style={styles.empty}>No workout history found.</Text>;

  return (
    <View style={styles.section}>
      <Text style={styles.sectionTitle}>Workout History</Text>
      <FlatList
        data={workouts}
        keyExtractor={(item) => item.id.toString()}
        renderItem={({ item }) => (
          <TouchableOpacity onPress={() => handleWorkoutPress(item)}>
            <View style={styles.card}>
              <Text style={styles.workoutName}>{item.workout_name}</Text>
              <Text style={styles.date}>{new Date(item.start_time).toLocaleString()}</Text>
              <Text style={styles.duration}>Duration: {item.duration ? `${item.duration} sec` : "-"}</Text>
              <Text style={styles.exercisesTitle}>Exercises:</Text>
              {Array.isArray(item.exercises) && item.exercises.map((ex, idx) => (
                <Text key={idx} style={styles.exerciseItem}>- {ex.name}</Text>
              ))}
              {item.notes ? <Text style={styles.notes}>Notes: {item.notes}</Text> : null}
            </View>
          </TouchableOpacity>
        )}
      />
      <Modal
        visible={modalVisible}
        animationType="slide"
        transparent={true}
        onRequestClose={closeModal}
      >
        <View style={styles.modalOverlay}>
          <View style={styles.modalContent}>
            <ScrollView>
              {selectedWorkout && (
                <>
                  <Text style={styles.modalTitle}>{selectedWorkout.workout_name}</Text>
                  <Text style={styles.date}>{new Date(selectedWorkout.start_time).toLocaleString()} - {new Date(selectedWorkout.end_time).toLocaleString()}</Text>
                  <Text style={styles.duration}>Duration: {selectedWorkout.duration ? `${selectedWorkout.duration} sec` : "-"}</Text>
                  <Text style={styles.exercisesTitle}>Exercises:</Text>
                  {Array.isArray(selectedWorkout.exercises)
                    ? selectedWorkout.exercises.map((ex, idx) => (
                        <Text key={idx} style={styles.exerciseItem}>- {ex.name}</Text>
                      ))
                    : <Text style={styles.exerciseItem}>{selectedWorkout.exercises}</Text>}
                  {selectedWorkout.notes ? <Text style={styles.notes}>Notes: {selectedWorkout.notes}</Text> : null}
                </>
              )}
            </ScrollView>
            <Button title="Close" onPress={closeModal} />
          </View>
        </View>
      </Modal>
    </View>
  );
};

const styles = StyleSheet.create({
  section: { marginTop: 24, paddingHorizontal: 16 },
  sectionTitle: { fontSize: 20, fontWeight: "bold", marginBottom: 12 },
  card: { backgroundColor: "#f9f9f9", borderRadius: 8, padding: 12, marginBottom: 12 },
  workoutName: { fontSize: 16, fontWeight: "bold" },
  date: { color: "#666", fontSize: 13, marginBottom: 2 },
  duration: { fontSize: 13, marginBottom: 2 },
  exercisesTitle: { fontWeight: "bold", marginTop: 6 },
  exerciseItem: { marginLeft: 8, fontSize: 13 },
  notes: { fontStyle: "italic", marginTop: 6 },
  error: { color: "red", marginTop: 20 },
  empty: { color: "#666", marginTop: 20 },
  // Modal styles
  modalOverlay: {
    flex: 1,
    backgroundColor: "rgba(0,0,0,0.5)",
    justifyContent: "center",
    alignItems: "center",
  },
  modalContent: {
    backgroundColor: "#fff",
    borderRadius: 12,
    padding: 24,
    width: "85%",
    maxHeight: "75%",
    shadowColor: "#000",
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.2,
    shadowRadius: 8,
    elevation: 5,
  },
  modalTitle: { fontSize: 20, fontWeight: "bold", marginBottom: 8 },
});

export default WorkoutHistory;
